script: |
  super -f text -I q6223.spq | sort > q6223.out

inputs:
  - name: q6223.spq
    data: |
      SELECT DISTINCT col1 * + col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 64 * + col2 NOT BETWEEN - col1 AND ( - ( - col2 ) * + + ( + col1 ) - 66 );
  - name: tab1

outputs:
  - name: q6223.out
    data: |
